import logo from "./logo.svg";
import "./App.css";
import List from "./components/List";
import { useState } from "react";

function App() {
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");

  return (
    <div className="App">
      제목 :{" "}
      <input type="text" value={title} onChange={(pre) => setTitle(pre)} />
      내용 :{" "}
      <input type="text" value={content} onChange={(pre) => setContent(pre)} />
      <List title={title} content={content} />
    </div>
  );
}

export default App;
